INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 596, 0, "今日の運勢は小吉！　空を眺めると気持ちが晴れやかに！　　　　眺めるだけじゃなくて、ひとっ飛びしちゃいましょうかっ♪", "", 2, "", 4, 0, 2, 0, 60005);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 597, 0, "今日の運勢は小吉！　掃除をすると運勢が開けそう！　　　　　　「わ、めんど」「ヴルムっ！　新年早々サボっちゃダメなんだからね！」", "", 2, "", 4, 0, 2, 0, 60005);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 598, 190804, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", "", 0, "カリン", 0, 2, 3, 0, 60005);
INSERT INTO `v1_4304a5764ae5bd23cd46ff88ee600f79ed376d9f862c6bdd99b1161d627afeb0` VALUES (0, 599, 190804, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", "", 0, "カリン", 0, 3, 3, 7, 60005);
